import React,{Fragment} from 'react';

export const Especialidades = ({especialidades}) => {
    return (
        <Fragment>
            {especialidades.map((especialidad,index) => {
                return (<div key={especialidad.id}>{especialidad.titulo}</div>)
            })
        }
        </Fragment>
    );
};
